import '../styles/TrackRide.css';
import Navbar from "../components/Navigation_Bar/Navbar";

function TrackRide() 
{
    return (
        <div className='TrackRide'>
            <Navbar />
            <h1>Track Ride</h1>
        </div>
    );
}

export default TrackRide;
